import React from "react";
import Pred from "./Pred";

function Info() {
  return (
    <div className="Info">
        
        <p>GET запрос состоит из json в одном запросе нельзя отправлять более чем 10 векторов признаков для предсказания</p>
      
    </div>
  );
}

export default Info;
